import React from "react";

const Home=()=>{
    return(
        <>
        <p className="content_style">Saraswati Seva Foundation (SSF) is a mission-driven nonprofit that aims to reduce poverty and promote social justice by educating children, enabling youths by powering new-age skills, empowering women through skills for gender equality, and supporting rural youth and farmers in agripreneurship.</p>
        <p className="content_style">Partnering with other development agencies and institutions, SSF helps remote communities lead change.</p>
        </>
    );
}

export default Home;
